- input: "TEXT\x1CC00454009\x1C.TEXT\x1C\x1CF3XA\x1CThis amended report addresses
    the discrepancies noted in the letter dated November 10, 2010, reference: October
    Quarterly Report.  The first item on that letter noted that TDWCC apparently qualified
    as a Multi-candidate committee.   However we have not made contributions to at
    least five federal candidates.  As shown on this report, several of the candidates
    to whom we made contributions are local or state candidates and are now included
    on line 29 rather than line 23.  We made contributions to only one federal candidate
    during this period.\n"
